import PropTypes from 'prop-types'

const Button = ({color,text}) => {

    const onClick = (e) =>{
        alert('hello');
    }

  return (
    <button className="btn" 
    onClick={onClick} 
    style={{backgroundColor:color}}>{text}</button>
  )
}

Button.propTypes = {
    color:PropTypes.string,
    text:PropTypes.string
}

export default Button
